column5:
Update deps

- AVA 0.16
- react-router-scroll 0.3.0
- Fix destructuring in Node 6,
https://phabricator.babeljs.io/T7086#77955, so we can write such code:

const d = { a: 'a', b: 'b', c: 'c', d: 'd'};
let {a, b, ...c} = d;
console.log(a); // a
console.log(b); // b
console.log(c); // { c: ‘c’, d: ‘d’ }

and

const fok = ({a, b, ...c}) => {
  console.log(a); // a
  console.log(b); // b
  console.log(c); // { c: ‘c’, d: ‘d’ }
};
fok(d);

Add fields setValue method

It allows us to set arbitrary value to fields state. Example:
fields.error.setValue(result.payload);

Remove eslint func-style rule.

Because both syntaxes are useful.
// For actions
function foo() {
}
// For predicates.
// const isFoo = (foo) => foo > 1
